from PIL import Image
import base64
import io
import os
import cv2
import numpy as np
import pyperclip
#from ML.train_face import train_face

image = "data:image/jpeg;base64,"

b = bytes(image, 'utf-8')
image = b[b.find(b'/9'):]
im = Image.open(io.BytesIO(base64.b64decode(image)))

BASE_DIR = os.path.dirname(os.path.abspath(__file__))
BASE_DIR = os.path.join(BASE_DIR, "ML")
im.save(BASE_DIR+'/tes.jpg')

im = np.array(im)

cv2.imshow("image", im)
cv2.waitKey(0)
cv2.destroyAllWindows()

#im = Image.fromarray(im)
#im.save(BASE_DIR+'/tes.jpg')

image_rgb = cv2.cvtColor(im, cv2.COLOR_BGR2RGB)
imagebgr_encode = cv2.imencode('.jpeg', image_rgb)[1]
image_base64_byte = base64.b64encode(imagebgr_encode)
image_base64_str = str(image_base64_byte, 'utf-8')
pyperclip.copy(str(image_base64_str))


